const LatestItem = ({
  memory,
}) => {
    return (
            <li className="Latest-Items-List-Item">
              <h3 className="Latest-Items-List-Item-Title"> {memory.Title}dasd </h3>
              <h3 className="Latest-Items-List-Item-Date"> {memory.Date} </h3>
              <img src={require('../images/Background.jpeg').default}  alt=""/>
            </li>
  );
};
  
export default LatestItem;
